const https = require('https');
const fs = require('fs');
const path = require('path');
const { debug } = require('console');

// Función sleep para esperar cierto tiempo (en milisegundos)
function sleep(ms) {
    return new Promise(resolve => setTimeout(resolve, ms));
  }

// Función para descargar una imagen desde una URL y guardarla en la ruta especificada
function descargarImagen(url, rutaDestino) {
    const archivo = fs.createWriteStream(rutaDestino);
  
    // Opciones para omitir la verificación del certificado
    const opciones = {
      rejectUnauthorized: false  // Esto desactiva la validación SSL (no recomendado en producción)
    };
  
    https.get(url, opciones, (response) => {
      if (response.statusCode === 200) {
        response.pipe(archivo);
  
        archivo.on('finish', () => {
          archivo.close();
          console.log(`Imagen descargada y guardada en ${rutaDestino}`);
        });
      } else {
        console.log(`Error al descargar la imagen de ${url}. Código de estado: ${response.statusCode}`);
      }
    }).on('error', (err) => {
      fs.unlink(rutaDestino, () => {}); // Elimina el archivo si ocurre un error
      console.error(`Error descargando ${url}: ${err.message}`);
    });
}

