// Función para descargar todas las imágenes de una lista de URLs con un delay
async function descargarImagenes(urls) {
    //debugger;
    for (let i = 0; i < urls.length; i++) {
      const url = urls[i];
      const nombreArchivo = path.basename(url); //`imagen_${i + 1}.jpg`; // Nombre de archivo dinámico
      const rutaGuardar = path.join(__dirname, 'images', nombreArchivo); //path.join(__dirname, nombreArchivo);  // Ruta de guardado
      descargarImagen(url, rutaGuardar);
  
      // Espera de 2 milisegundos antes de la siguiente descarga
      await sleep(2);
    }
  }

